package ch.uzh.csg.reimbursement.example;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.fail;

import org.hibernate.HibernateException;
import org.hibernate.Session;
import org.hibernate.SessionFactory;
import org.hibernate.Transaction;
import org.hibernate.cfg.Configuration;
import org.junit.BeforeClass;
import org.junit.Ignore;
import org.junit.Test;

import ch.uzh.csg.reimbursement.server.model.Signature;

public class SignatureTest {


	// bild in die db laden
	// add cropping testen
	private static String contentAsString;
	private static long contentSize;
	private static String contentType;
	private static Signature signature;
	private static SessionFactory factory;

	@Ignore
	@BeforeClass
	public static void setup(){
		contentAsString = "";
		contentSize = 25626;
		contentType = "image/png";

		byte[] content = contentAsString.getBytes();
		signature = new Signature(contentType, contentSize, content);

		try{
			factory = new Configuration().configure().buildSessionFactory();
		}catch (Throwable ex) {
			System.err.println("Failed to create sessionFactory object." + ex);
			throw new ExceptionInInitializerError(ex);
		}
	}

	@Ignore
	@Test
	public void testSignatureCreation() {
		Session session = factory.openSession();
		Transaction tx = null;

		String contentInDb = "";
		try{
			tx = session.beginTransaction();
			contentInDb = (String)session.get(Signature.class, "content");
			tx.commit();
		}catch (HibernateException e) {
			if (tx!=null) tx.rollback();
			e.printStackTrace();
		}finally {
			session.close();
		}

		assertEquals("Check if content ist the same", contentAsString, contentInDb);
	}

	@Ignore
	@Test
	public void testAddCropping() {


		fail("Not yet implemented");
	}

}
